import React from "react";

const Avatar = ({image,scale}) => {
    const height = "h-[" + Math.floor(48.0*scale) + "px]";
    const width = "w-[" + Math.floor(48.0*scale) + "]px";
    console.log(height,width);
    return (
        <div className={`${height} ${width} rounded-full shadow-md`}>
            <img src = {image} className = "w-full h-full rounded-full object-cover" alt = "avatar"/>
        </div>
    );
}

export default Avatar;
